// src/Pages/events.js
import React from 'react';
import eventform from '../components/vents/eventform'; // Corrected path for eventForm
import eventlist from '../components/events/eventlist'; // Corrected path for eventList

function Events() {
  return (
    <div>
      <h1>Events</h1>
      <eventform />
      <eventlist />
    </div>
  );
}

export default Events;
